// TransactionSuccessPage.jsx

import React from 'react';
import { useLocation } from 'react-router-dom';
import './TransactionSuccessPage.css';

function TransactionSuccessPage() {
    const location = useLocation();
    const transactionDetails = location.state?.transactionDetails || {};

    return (
        <div>
            <h2>Transaction Successful</h2>
            <p>Transaction ID: {transactionDetails.transactionId}</p>
            <p>Date: {transactionDetails.date}</p>
            <p>Time: {transactionDetails.time}</p>
            <p>Sender's User ID: {transactionDetails.details?.senderUserId}</p>
            <p>Receiver's Transaction ID: {transactionDetails.details?.receiverTransactionId}</p>
            <p>Amount: {transactionDetails.details?.amount}</p>
            <p>Reason: {transactionDetails.details?.reason}</p>
            <p>Thank you for transferring!</p>
        </div>
    );
}

export default TransactionSuccessPage;
